        }
    }
    return searchedBooks;
  }
  if(searchby == "Book by Author"){
    for(let i=0;i<localStorage.length;i++){
      let book=localStorage.key(i);
      let values=JSON.parse(localStorage.getItem(book));
        if(values.bookauthor.toLowerCase() == text.toLowerCase()){
            searchedBooks.push(values);
        }
    }
    return searchedBooks;
  }
}

function searchBooksByValue(value:string,searchby:string){
  let searchedbooks =[];
  for(let i=0;i<localStorage.length;i++)
  {
    let bookObj=localStorage.key(i);
    let bookData=JSON.parse(localStorage.getItem(bookObj));
    if(searchby == "Min Rating")
    {
      let minimumRating=bookData.bookrating;
      if(minimumRating >= JSON.parse(value))
      {
          searchedbooks.push(bookData);
      }
    }

    if(searchby == "Min Price")
    {
      let minimumPrice=bookData.bookprice;
      if(minimumPrice >= JSON.parse(value))
      {
          searchedbooks.push(bookData);
      }
    }
    if(searchby == "Max Price")
    {
      let maximumPrice=bookData.bookprice;
      if(maximumPrice <= JSON.parse(value))
      {
          searchedbooks.push(bookData);
      }
    }
}
return searchedbooks;

}
